  import { db, auth } from "../firebase-config";

export const Review = (props) => {
    const { review } = props;
    return (
        <div className="reviewContainer">
            <div className="title">
                <h3>{review.title}</h3>
            </div>
            <div className="body">
                <h3>{review.description}</h3>
            </div>

            <div className="footer">
                <p>{review.username}</p>
            </div>
        </div>
    );
};
